import * as React from "react";
import PageTitle from "../shared/PageTitle";

function Signup() {
  return (
    <>
      <PageTitle title="Sign-up" />
      <div>
        <h1>Sign-up</h1>
      </div>
    </>
  );
}
export default Signup;
